import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import App from './App';
import DiagnosticCenter from './pages/DiagnosticCenter';
import Insurance from './pages/Insurance';
import { About, Header, Pricing, Features } from './containers';
import { Footer } from './components';
import './index.css';
import { createBrowserRouter, RouterProvider } from "react-router-dom";


const createApp = () => {
const router = createBrowserRouter([
  {
    path: "/",
    element: (
      <React.StrictMode>
        <RouterProvider router={router}>
          <App />
        </RouterProvider>
      </React.StrictMode>
    ),
    children: [
      { index: true, element: <div><Header /></div> },
      { path: "/about", element: <div><About /></div> },
      { path: "/features", element: <div><Features /></div> },
      { path: "/pricing", element: <div><Pricing /></div> },
      { path: "/contact", element: <div><Footer /></div> },
    ],
  },
  {
    path: "/diagnosticCenter",
    element: <div><DiagnosticCenter /></div>,
  },
  {
    path: "/insurance",
    element: <div><Insurance /></div>,
  },
]);

ReactDOM.createRoot(document.getElementById("root")).render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
};
createApp();
